import React, { Component } from 'react'
import { Card,Button } from 'antd';


export default class Category extends Component {
    render() {
        return (
            <>
                <Card title="" extra={<Button href="#">右上角</Button>}>
                    <p>表格</p>
                    
                </Card>
            </>
        )
    }
}
